import Head from 'next/head';
import 'bootstrap/dist/css/bootstrap.min.css';
import Menu from '../components/Menu';

const HomePage = () => (
    <div>
        <Head>
    <title>CodaMe - Tailwind - Next.Js</title>
    <link rel="icon" href="/favicon.ico" />
  </Head>
        <Menu />
        Home!!
    </div>
)

  export default HomePage
